import{_ as t,c as d,o as e,a as i}from"./app.5f5e8a2c.js";const _=JSON.parse('{"title":"快速开始","description":"","frontmatter":{},"headers":[{"level":3,"title":"使用方法","slug":"使用方法","link":"#使用方法","children":[]},{"level":3,"title":"推荐连接方式","slug":"推荐连接方式","link":"#推荐连接方式","children":[]},{"level":2,"title":"连接方式1: APP","slug":"连接方式1-app","link":"#连接方式1-app","children":[]},{"level":2,"title":"连接方式2: 浏览器","slug":"连接方式2-浏览器","link":"#连接方式2-浏览器","children":[]},{"level":2,"title":"连接方式3: 订阅","slug":"连接方式3-订阅","link":"#连接方式3-订阅","children":[]},{"level":2,"title":"连接方式4: IE浏览器","slug":"连接方式4-ie浏览器","link":"#连接方式4-ie浏览器","children":[]},{"level":2,"title":"连接方式5: 定制程序","slug":"连接方式5-定制程序","link":"#连接方式5-定制程序","children":[]}],"relativePath":"index.md","lastUpdated":1676235797000}'),r={name:"index.md"},a=i('<h1 id="快速开始" tabindex="-1">快速开始 <a class="header-anchor" href="#快速开始" aria-hidden="true">#</a></h1><p>  工一云电脑是一种定制融合云产品与服务，是面向未来的AnyTime、AnyWhere、AnyDevice的一致性云办公与教学云解决方案。工一云电脑底座采用自主研发，上层基于主流的微软桌面，它不是简单的云桌面，而是云+电脑+云盘+项目管理+软件+3D优化+终端优化等一系列功能集大成后的定制产品与服务。</p><p>  支持各种电脑、平板、手机、智能电视、单片机、零瘦客户机等终端设备，同时支持Windows、Andriod、iOS、iPadOS、macOS，ChromeOS、HarmonyOS、WinPhoneOS、RaspBerryOS、ThinOS、Linux Desktop、Linux Server几乎所有的主流操作系统。连接的方式也包含APP、浏览器、订阅、IE浏览器、定制程序等多种连接方式。</p><h3 id="使用方法" tabindex="-1">使用方法 <a class="header-anchor" href="#使用方法" aria-hidden="true">#</a></h3><ol><li>根据下表查找对应设备、系统的推荐连接方式；</li><li>选择其中一种推荐连接方式，具体步骤参考下面对应的连接方式；</li></ol><h3 id="推荐连接方式" tabindex="-1">推荐连接方式 <a class="header-anchor" href="#推荐连接方式" aria-hidden="true">#</a></h3><p>  最常用的连接方式是APP和浏览器，支持APP的首先推荐APP进行连接，其次是浏览器；临时性一次性使用推荐浏览器；具体推荐的连接方式如下：</p><div align="center">各设备推荐的连接方式表</div><table><thead><tr><th>操作系统</th><th>台式/一体机/笔记本/微型电脑/虚拟机</th><th>平板</th><th>手机</th><th>智能电视</th><th>单片机</th><th>零瘦客户端</th></tr></thead><tbody><tr><td>Windows</td><td>APP, 浏览器, 订阅, IE浏览器</td><td>同左</td><td></td><td></td><td></td><td></td></tr><tr><td>Andriod</td><td></td><td>APP, 浏览器</td><td>APP</td><td>APP</td><td></td><td></td></tr><tr><td>iOS</td><td></td><td></td><td>APP</td><td></td><td></td><td></td></tr><tr><td>iPadOS</td><td></td><td>APP, 浏览器</td><td></td><td></td><td></td><td></td></tr><tr><td>macOS</td><td>APP, 浏览器</td><td></td><td></td><td></td><td></td><td></td></tr><tr><td>ChromeOS</td><td></td><td>APP, 浏览器</td><td>APP</td><td></td><td></td><td></td></tr><tr><td>HarmonyOS</td><td></td><td>APP, 浏览器</td><td>APP</td><td></td><td></td><td></td></tr><tr><td>WinPhoneOS</td><td></td><td></td><td>APP</td><td></td><td></td><td></td></tr><tr><td>RaspBerryOS</td><td></td><td></td><td></td><td></td><td>定制程序</td><td></td></tr><tr><td>ThinOS</td><td></td><td></td><td></td><td></td><td></td><td>定制程序</td></tr><tr><td>Linux Desktop</td><td>浏览器</td><td>浏览器</td><td></td><td></td><td></td><td></td></tr><tr><td>Linux Server</td><td>定制程序</td><td></td><td></td><td></td><td>定制程序</td><td>定制程序</td></tr></tbody></table><h2 id="连接方式1-app" tabindex="-1">连接方式1: APP <a class="header-anchor" href="#连接方式1-app" aria-hidden="true">#</a></h2><p>  适合支持安装APP客户端的系统。<br>   不同终端系统的APP客户端不同，但操作大同小异，本示例以Andriod手机为例。首先根据系统点击以下对应的链接进行下载安装；</p><ol><li><a href="/co-docs/download.html">下载APP</a>，安装APP后打开应用，点击右上角的加号，选择“添加工作区”，外网输入<code>https://tx2.cec.cc:88</code>，内网输入<code>https://tx.cec.cc</code>，用户账户点击下拉选择“添加用户账户”，输入个人账号<code>demo@cec.cc</code>和个人密码并点击保存；</li><li>然后点击右上角的“下一步”，等待加载一两秒钟，点击“工作区”，此时会显示所有的应用程序和桌面资源；</li><li>点击桌面或应用会弹出一个连接选项框，点击“连接”；</li><li>进入桌面或应用后，顶部会出现一个鼠标键盘选项，移动端的鼠标操作分触屏模式和鼠标模式，根据习惯选择对应的模式即可。</li></ol><p>  注：此方式不支持本地电脑与云电脑的复制粘贴，仅订阅、IE浏览器方式支持。</p><h2 id="连接方式2-浏览器" tabindex="-1">连接方式2: 浏览器 <a class="header-anchor" href="#连接方式2-浏览器" aria-hidden="true">#</a></h2><p>  适用于所有安装有H5浏览器的桌面系统。<br>   目前主流的浏览器都支持Html5：360、Edge、Opera、Chrome、Safari、Firefox浏览器等。</p><ol><li>H5浏览器只需输入<code>https://tx.cec.cc</code>，输入用户名和密码进行登录；</li><li>登陆到资源页面可就以访问远程云应用和云电脑了，部分应用不能支持，可以采用登陆桌面方式进行访问；如果要输入中文，需要点击右上角“设置”按钮，启用输入法编辑器“开”，回到应用或桌面，可以用Shift切换语言；</li><li>点击进入云应用或云电脑，图为H5浏览器的嵌入式访问效果。</li></ol><p>  注：此方式不支持本地电脑与云电脑的复制粘贴，仅订阅、IE浏览器方式支持。</p><h2 id="连接方式3-订阅" tabindex="-1">连接方式3: 订阅 <a class="header-anchor" href="#连接方式3-订阅" aria-hidden="true">#</a></h2><p>  仅适用于windows桌面系统。</p><ol><li>控制面板打开RemoteApp与桌面连接；</li><li>按照向导输入URL地址，外网输入<code>https://tx2.cec.cc:88</code>，内网输入<code>https://tx.cec.cc</code>；</li><li>最后就可在开始程序菜单直接访问远程应用和桌面。</li></ol><p>  注：非云电脑时，打开第一个云应用或云电脑时需要输入账户和密码，只要保持至少一个不关闭，打开后续即为免密。</p><h2 id="连接方式4-ie浏览器" tabindex="-1">连接方式4: IE浏览器 <a class="header-anchor" href="#连接方式4-ie浏览器" aria-hidden="true">#</a></h2><p>  适用于具有IE浏览器的windows系统。<br>   Windows终端可以通过IE浏览器连接，实际是系统自带了“远程桌面连接”APP客户端工具，通过浏览器调用工具打开远程应用或桌面。<br>   注意：WinXP和Win7在非局域网环境下并不支持IE浏览器方式连接，请参照H5浏览器。</p><ol><li>打开IE浏览器，地址栏输入<code>https://tx.cec.cc</code>，输入用户名和密码进行登录；</li><li>首次登录会提示保存密码，点击“是”，方便下次登陆；</li><li>首次登录还会提示是否运行加载项，点击“允许”，可以实现更佳访问云应用和云桌面体验；</li><li>非同域中电脑首次打开会提示信任发布者提示，勾选“不再询问我是否从此发布者进行远程连接”，可获得更佳的单点访问体验。</li></ol><h2 id="连接方式5-定制程序" tabindex="-1">连接方式5: 定制程序 <a class="header-anchor" href="#连接方式5-定制程序" aria-hidden="true">#</a></h2><p>  一般适用于非桌面系统或者定制thinos。普通用户一般无需关注。</p>',26),l=[a];function h(c,n,o,s,p,P){return e(),d("div",null,l)}const x=t(r,[["render",h]]);export{_ as __pageData,x as default};
